import React from "react";
import ExampleResponse from  "../data/exampleresponse.json"


export const Video = () => {


let listThem = ExampleResponse.map(object => {
   return object.url.substring(32,object.url.length)
})
let titles = ExampleResponse.map(object => {
    return object.title
})



return (
    <div>
        {listThem.map((val,index) => {
            return <iframe className="m-2" width="355" height="200" src={`https://www.youtube.com/embed/${val}`} title={titles[index]} frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        })
        
        }

     <i class="fa-sharp fa-regular fa-thumbs-up"></i>
     <i class="fa-sharp fa-regular fa-thumbs-down"></i>
    </div>
)
}
